import Navigation from "./components/Header.js";
import Content from "./components/Content.js";
import Footer from "./components/Footer.js";
import rocketImg from './assets/rocket1.png';
import { Signup } from './components/Signup.js';


function App() {
  return (
    <div className="App">
      <Navigation />
      <Content />
      <Footer />
      <Route exact path="./components/Signup.js" component={Signup} />
      <button>
       <Link to="./components/Signup">
              Login
            </Link>
       </button>
    </div>
  );
}

export default App;
